def part(L):
    d = len(L)
    partition = [-1]
    for i in range(1,10):
        c = (i*d)//10
        while not L[c]=='|': c+=1
        partition.append(c)
    partition.append(d)
    return partition

def dec(comp):
    x, y = 0, 0
    p = part(comp)
    for i in range(10):
        L=comp[p[i]+1:p[i+1]].split('|')
        print(L)
        for bloc in L:
            c = int(bloc[0]) * 32
            if len(bloc) < 3:
                fill_rect(x*4, y*4, 4, 4, (c, c, c))
                if x == 79:
                    x = 0
                    y += 1
                else:
                    x += 1
            else:
                length = int(bloc[2:])
                if length + x>80:
                    fill_rect(x * 4, y * 4, 360 - x*4, 4, (c, c, c))
                    y += 1
                    x = length + x - 80
                    fill_rect(0, y * 4, length*4 , 4, (c, c, c))
                else:
                    fill_rect(x * 4, y * 4, length*4, 4, (c, c, c))
                    x+=length

